import React from'react';

function Login() {
  return (
    <div className="Login">
      <form className="loginForm">
        <h2>Login</h2>
        <input type="email"/>
        <input type="password"/>
        <button className="loginButton">Login</button>
      </form>
    </div>
  );
}

export default Login;
